import React from "react";
import { makeStyles, Typography, Card, CardContent, CardActionArea, CardActions } from "@material-ui/core";
import EditRoundedIcon from '@material-ui/icons/EditRounded';


import styles from "../styles/SurveyCardStyle";


const useStyles = makeStyles(styles);

function SurveyCard() {

  const classes = useStyles();


  const idTest="00000";
  const responseTest=8;
  const timeTest= new Date().toLocaleDateString();

  
  return (
    <React.Fragment>
      <Card className={classes.root} >
        <CardContent className={classes.details} >
          <Typography variant="h5">Survey Demo 1</Typography>
          <Typography>ID: {idTest}</Typography>
          <Typography>Responses: {responseTest}</Typography>
          <Typography>Time: {timeTest}</Typography>
        </CardContent>
        <CardActions>

        </CardActions>
      </Card>
    </React.Fragment>
  )


}

export default SurveyCard;
